INSERT INTO `conservation` VALUES (1,'Conservation should focus on preventing deterioration rather than substituting existing components','2025-08-11 16:59:26','2025-08-11 16:59:26'),(2,'Use traditional materials for maintenance, repairs, and reinforcement to minimize nonreversible modifications','2025-08-11 16:59:55','2025-08-11 16:59:55'),(3,'Prioritize reversible adaptations to maintain the buildings\' vernacular style if complex solutions are needed for technical or safety reasons','2025-08-11 17:00:39','2025-08-11 17:00:39'),(4,'Building modifications are acceptable if they serve purposes like continued family use, accessibility, or agriculture requirements. Any changes should be in line with the vernacular character of the village','2025-08-11 17:02:53','2025-08-11 17:02:53'),(5,'Volume additions must match the current footprint, height, and stories. The new additions should be clearly distinguishable from the original building and designed to visually complement it','2025-08-11 17:02:59','2025-08-11 17:02:59'),(6,'Substitute nontraditional tiles with stone slate tiles','2025-08-11 17:03:03','2025-08-11 17:03:03'),(7,'Substitute nontraditional doors and windows with wooden ones','2025-08-11 17:03:07','2025-08-11 17:03:07'),(8,'Preserve existing vernacular components','2025-08-11 17:03:11','2025-08-11 17:03:11'),(9,'Minimize the impact of existing alterations to restore part of the buildings’ cultural significance','2025-08-11 17:03:15','2025-08-11 17:03:15'),(10,'Nontraditional materials can be used for maintenance, repairs, and reinforcement in nonvernacular components, provided they don’t damage existing vernacular elements','2025-08-11 17:03:23','2025-08-11 17:03:23'),(11,'Building modifications are acceptable if they conserve existing vernacular components. Any changes should be in line with the vernacular character of the village','2025-08-11 17:03:30','2025-08-11 17:03:30'),(12,'Conservation efforts must adhere to the “principle of minimal intervention”, unless a proposed intervention provides demonstrable community benefit','2025-08-11 17:03:37','2025-08-11 17:03:37'),(13,'Maintain the building\'s historical function','2025-08-11 17:04:12','2025-08-11 17:04:12'),(14,'Musealization can be implemented if the intention is to highlight the building\'s historical role in the community','2025-08-11 17:04:48','2025-08-11 17:04:48'),(15,'Preserve the building\'s historical use as much as feasible; explore other uses if they demonstrably improve community value','2025-08-11 17:05:25','2025-08-11 17:05:25'),(16,'Use reversible and traditional methods to stabilize and prevent collapse, where possible.','2025-08-11 17:05:37','2025-08-11 17:05:37'),(17,'Implement measures to reduce water infiltration and damage to the ruins','2025-08-11 17:05:41','2025-08-11 17:05:41'),(18,'Assess state of ruins to determine if they can be safely adaptable for public use','2025-08-11 17:05:46','2025-08-11 17:05:46'),(19,'Reconstruct using traditional methods and materials based on historical evidence','2025-08-11 17:05:50','2025-08-11 17:05:50'),(20,'Additions or adaptations may be considered if exact reconstruction isn\'t possible or functional requirements are needed, as long as they\'re clearly justified and do not compromise the village authenticity','2025-08-11 17:06:38','2025-08-11 17:06:38'),(21,'Incorporate vernacular architectural elements in the buildings, such as forms, proportions, materials, textures, and colors, to reduce visual and functional impacts and integrate them with local vernacular style','2025-08-11 17:06:56','2025-08-11 17:06:56'),(22,'Nontraditional materials can be used for maintenance, repairs, and reinforcement','2025-08-11 17:07:01','2025-08-11 17:07:01'),(23,'Building modifications are acceptable','2025-08-11 17:07:04','2025-08-11 17:07:04'),(24,'Volume additions must match the current footprint, height, and stories','2025-08-11 17:07:06','2025-08-11 17:07:06'),(25,'Incorporate vernacular architectural elements in the buildings, such as forms and proportions to reduce visual and functional impacts and integrate them with local vernacular style','2025-08-11 17:07:09','2025-08-11 17:07:09'),(26,'Evaluate if complete roof replacement, rather than simple repairs, may be necessary to preserve the vernacular character of the roof','2025-08-11 17:07:14','2025-08-11 17:07:14'),(27,'Evaluate cement-based renders to determine if they can be safely removed to reveal any underlying stonework','2025-08-11 17:07:18','2025-08-11 17:07:18');
